import React from "react";
import Anasayfa from "./components/anasayfa";
import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Anasayfa />} />
      </Routes>
    </BrowserRouter>
  );
};
export default App;
